import React, { useState } from "react";
import "./index.css";


const App = () =>{
    const state = useState();
    const [count,setCount] = useState(0);
    
    function clicks(){
        setCount(count + 1);
    }
   return(
       <>
             <h1 onClick={clicks}>{count}</h1>    
             <button>click me</button>
       </>
    

   );
};

export default App;
